class Header extends React.Component{
	render(){
		return(
					<div id="wrapper">
						<header id="header">
							<div class="inner">
									<a href="index.html" class="logo">
										<span class="symbol"><img src="assets/img/logo.svg" alt="" /></span><span class="title">Phantom</span>
									</a>
							</div>
						</header>
					</div>
				)
		}
}
export default Header
